import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input and type a query
    await page.waitForSelector('input.search-input');
    await page.fill('input.search-input', 'jun');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click the search button
    await page.waitForSelector('button.search-btn');
    await page.click('button.search-btn');

    // Wait for the search results to load (look for .search-header or .search-results)
    await page.waitForSelector('.search-header', { timeout: 5000 });
    await page.waitForSelector('.search-results', { timeout: 5000 });

    // Take screenshot of search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract the titles of the first 3 search results
    const searchResults = await page.$$eval('.search-result-item .result-title', nodes =>
      nodes.slice(0, 3).map(n => n.textContent.trim())
    );

    // Click the first search result to go to the video player page
    const firstResult = await page.$('.search-result-item');
    if (firstResult) {
      await firstResult.click();
    }

    // Wait for the video player to load (look for .video-player)
    await page.waitForSelector('.video-player', { timeout: 5000 });

    // Take screenshot of the video player page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_video_player.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_video_player.png'));

    // Extract video title and channel name
    const videoTitle = await page.$eval('.video-title', el => el.textContent.trim());
    const channelName = await page.$eval('.channel-name', el => el.textContent.trim());

    // Scroll to comments section and extract number of comments
    await page.locator('.comments-section').scrollIntoViewIfNeeded();
    await page.waitForSelector('.comments-header h3', { timeout: 3000 });
    const commentsHeader = await page.$eval('.comments-header h3', el => el.textContent.trim());

    // Take screenshot of comments section
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_comments_section.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_comments_section.png'));

    // Extract the text of the first comment (if any)
    let firstCommentText = null;
    const commentExists = await page.$('.comments-list .comment-text');
    if (commentExists) {
      firstCommentText = await page.$eval('.comments-list .comment-text', el => el.textContent.trim());
    }

    return {
      success: true,
      action: "Performed a search for 'jun', navigated to the first result's video page, and extracted video and comment data.",
      extractedData: {
        searchResults,
        videoTitle,
        channelName,
        commentsHeader,
        firstCommentText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
